def setUpLogger(logPath, logLevel=logging.INFO):
  logFileName = 'createSampleSheet'
  d = datetime.now()
  logFileName = logFileName + '_' + d.strftime('%Y-%m-%d_%H_%M_%S') + '.log'
  logging.basicConfig(filename=logPath + logFileName,
                      format='%(asctime)s [%(levelname)s] %(message)s', level=logLevel)
  logger = logging.getLogger(logFileName)
  return logger

def setUpParser(self):
  '''is there a more elegant way to mock parser object, except the v3.3
   unitest.mock object library?'''

  self.parser = OptionParser()
  self.parser.add_option('--verbose', dest='verbose')
  self.parser.add_option('--lineending', dest='lineending')
  self.parser.add_option('--maillist', dest='maillist')
  self.parser.add_option('--singlelane', dest='singlelane')
  self.parser.add_option('--flowcell', dest='flowcell')
  self.parser.add_option('--outdir', dest='outdir')
  self.parser.add_option('--debug', dest='debug')
  self.parser.verbose = False
  self.parser.lineending = 'linux'
  self.parser.maillist = False
  self.parser.singlelane = False
  self.parser.flowcell = '140127_SN792_0312_AC36DWACXX'
  self.parser.outdir = './'
  self.parser.debug = True
  return self.parser

